import konyv1 from "../assets/konyvek/konyv1.jpg"
import konyv2 from "../assets/konyvek/konyv2.jpg"
import konyv3 from "../assets/konyvek/konyv3.jpg"
import konyv4 from "../assets/konyvek/konyv4.jpg"
import konyv5 from "../assets/konyvek/konyv5.jpg"
