import konyv7 from "../assets/konyvek/konyv7.jpg"
import konyv8 from "../assets/konyvek/konyv8.jpg"
import konyv9 from "../assets/konyvek/konyv9.jpg"
import konyv10 from "../assets/konyvek/konyv10.jpg"
import konyv11 from "../assets/konyvek/konyv11.jpg"
