import konyv20 from "../assets/konyvek/konyv20.jpg"
import konyv21 from "../assets/konyvek/konyv21.jpg"
import { useNavigate } from "react-router-dom";
import { React, useState } from "react"
import { getProducts } from './GetProducts'


function Vasarlas() {
    /*
    var konyvek = [konyv1, konyv2, konyv3, konyv4, konyv5, konyv6, konyv7, konyv8, konyv9, konyv10, konyv11, konyv12, konyv13, konyv14, konyv15, konyv16, konyv17, konyv18, konyv19, konyv20, konyv21]
    var konyvek2 = ["konyv1", "konyv2", "konyv3", "konyv4", "konyv5", "konyv6", "konyv7", "konyv8", "konyv9", "konyv10", "konyv11", "konyv12", "konyv13", "konyv14", "konyv15", "konyv16", "konyv17", "konyv18", "konyv19", "konyv20", "konyv21"]

    const idk2 = []
    for (var i = 0; i < 21; i++) {
        idk2.push({
            logo: konyvek[i],
            Name: konyvek2[i],
            Price: konyvek2[i][konyvek2[i].length - 1] * 100,
            Distance: konyvek2[i][konyvek2[i].length - 1] * 10,
            Count: i,
        })
    }*/
    const [product, setProduct] = useState("")
    function HandleClick(id) {
        const navigate = useNavigate();
        navigate(`/Termek/${id}`);
    }
  
    fetch("https://localhost:44317/api/EladoTermek")
        .then((response) => {
            return response.json()
        })
        .then(data => {
            /*
            var main=document.getElementById("termekek")
            data.forEach((adat) => {
                if (adat.Aktiv) {
                    var termek=document.createElement("div")
                    termek.classList.add("termek")
                    termek.addEventListener('click',HandleClick(adat.Id))
        
                    var div1=document.createElement("div")
                    var img=document.createElement("img")
                    img.src=adat.Kep[0].EleresiUt
                    div1.appendChild(img)
        
                    var div2=document.createElement("div")
                    var span1=document.createElement("span")
                    span1.attributes.add('termekname')
                    span1.innerText=adat.Konyv.Cim
                    div2.appendChild(span1)
        
                    var div3=document.createElement("div")
                    var span2=document.createElement("span")
                    span2.attributes.add('termekprice')
                    span2.innerText=adat.Ar
                    div3.appendChild(span2)
                    var span3=document.createElement("span")
                    span3.attributes.add('termekdistance')
                    span3.innerText=adat.Ar + ' km'
                    div3.appendChild(span3)
        
                    termek.appendChild(div1)
                    termek.appendChild(div2)
                    termek.appendChild(div3)
                    main.appendChild(termek)
                    }})*/
                    var cards=[]
            data.forEach(adat => {
                var card=(
                    <div className="termek">
                        <div><img src={adat.Kep[0].EleresiUt} onClick={()=>{HandleClick(adat.Id)}} /></div>
                        <div><span id='termekname'>{adat.Konyv.Nev}</span></div>
                        <div><span id='termekprice'>{adat.Ar} Ft</span><span id='termekdistance' >{adat.Ar} km</span></div>
                    </div>)
                    cards.push(card)
                });
                setProduct(cards)
        })
        .catch((error) => {
            console.error("Hiba történt:", error);
        })

    return (
        <div className="content">
            <div className="sort">
                <span>Könyv címe: </span>
                <input type="text" />
                <div><span>Csere</span><input type="checkbox" name="Csere" id="" /></div>
                <select name="" id="">
                    <option value="">Legolcsóbb</option>
                    <option value="">Legdrágább</option>
                    <option value="">Legközelebb</option>
                    <option value="">Legújabb</option>
                    <option value="">Legrégebbi</option>
                </select>
                <span>Szerző neve: </span>
                <input type="text" />
            </div>
            <div className="termekek" id="termekek">
                {product}
            </div>
        </div>
    )
}

export default Vasarlas
